import Link from "next/link";

const About = () => (
  <div>
    <li>
      <Link href="/">
        <a>Home</a>
      </Link>
    </li>
    <h1>About Bitzprice</h1> <p>This is an app to view bitcoin prices</p>{" "}
  </div>
);
export default About;
